from typing import List
from collections import defaultdict
from math import gcd

class Solution:
    def maximumSum(self, nums: List[int]) -> int:
        def square_free_factorization(x):
            factor = 1
            for i in range(2, int(x**0.5) + 1):
                if x % (i * i) == 0:
                    x //= i * i
                    factor *= i
            return x

        factor_sum = defaultdict(int)
        max_sum = 0
        for num in nums:
            sf_factor = square_free_factorization(num)
            factor_sum[sf_factor] += num
            max_sum = max(max_sum, factor_sum[sf_factor])

        return max_sum

